import React, { Component } from 'react';
import {
    Menu,
    Item
  } from 'semantic-ui-react';

export class Navbar extends Component {
    render() {
        return (
            <div class="ui inverted segment">
                <div class="ui inverted secondary pointing menu">
                     <a class="item active">
                        Home
                    </a>
                    <a class="item">
                         Messages
                     </a>
                    <a class="item">
                        Friends
                    </a>
                </div>
            </div>
        )
    }
}

export default Navbar
